var A = 6;
var B = 2;
//resultado da soma
console.log("A = " + A);
console.log("B = " + B);
//Operador soma (+)
console.log("A + B = ", A + B);
//Operador de subtração (-)
console.log("A - B = ", A - B);
//Operador de multiplicação (*)
console.log("A * B = ", A * B);
//Operador de divisão (/)
console.log("A / B = ", A / B);
//Operador maior que (>)
console.log("A > B = ", A > B);
//Operador menor que ( < )
console.log("A < B = ", A < B);
//Operador AND (&&)
console.log("A > B && B < A = ", A > B && B < A);
//Operaodr OR (||)
console.log("A > B || B > A = ", A > B || A < B);
